-- ----------------------------
-- Table structure for `m_items`
-- ----------------------------
DROP TABLE IF EXISTS `m_items`;
CREATE TABLE `m_items` (
  `item_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '商品唯一ID',
  `item_code` varchar(50) NOT NULL DEFAULT '' COMMENT '商品编号（唯一）',
  `item_name` varchar(255) NOT NULL DEFAULT '' COMMENT '商品名称',
  `item_kind` int(11) NOT NULL DEFAULT '0' COMMENT '商品大分类（100：虚拟物品 200：数码产品 300：日用品）',
  `item_type` int(11) NOT NULL DEFAULT '0' COMMENT '商品中分类（110：）',
  `item_cat` int(11) NOT NULL DEFAULT '0' COMMENT '商品小分类',
  `cost_price` decimal(10,2) DEFAULT NULL COMMENT '成本价',
  `price` decimal(10,2) DEFAULT NULL COMMENT '市场价',
  `price_coins` int(10) DEFAULT NULL COMMENT '金币兑换价格',
  `stock` int(11) DEFAULT NULL COMMENT '现有库存',
  `min_stock` int(11) DEFAULT NULL COMMENT '安全库存',
  `brand` varchar(255) DEFAULT NULL COMMENT '品牌',
  `specification` varchar(255) DEFAULT NULL COMMENT '规格',
  `model` varchar(255) DEFAULT NULL COMMENT '型号',
  `pic_url` varchar(255) DEFAULT NULL COMMENT '图片缩略图URL',
  `create_by` bigint(20) NOT NULL DEFAULT '1' COMMENT '创建人',
  `create_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建日期',
  `update_by` bigint(20) DEFAULT NULL COMMENT '最后更新人',
  `update_date` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后更新时间',
  `is_delete` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否已删除',
  PRIMARY KEY (`item_id`),
  UNIQUE KEY `item_code` (`item_code`),
  KEY `item_name` (`item_name`),
  KEY `is_delete` (`is_delete`)
) ENGINE=InnoDB AUTO_INCREMENT=15 DEFAULT CHARSET=utf8 COMMENT='商品表';

