-- Table structure for `m_users`
-- ----------------------------
DROP TABLE IF EXISTS `m_users`;
CREATE TABLE `m_users` (
  `user_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '用户ID',
  `user_name` varchar(200) NOT NULL DEFAULT '' COMMENT '用户名(微信登录时存openid)',
  `password` varchar(50) DEFAULT NULL,
  `nickname` varchar(50) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '昵称',
  `gender` int(2) NOT NULL DEFAULT '1' COMMENT '性别（0：男 1：女 ）',
  `phonenumber` varchar(20) DEFAULT NULL COMMENT '联系电话',
  `email` varchar(80) DEFAULT NULL COMMENT '邮箱',
  `wxunionid` varchar(200) DEFAULT NULL COMMENT '微信unionid',
  `wxopenid` varchar(200) DEFAULT NULL COMMENT '微信openId',
  `qq` varchar(50) DEFAULT NULL COMMENT 'QQ',
  `user_type` int(2) DEFAULT '0' COMMENT '用户类型（0：系统用户 1：普通玩家 2：特约玩家）',
  `ispersonal` tinyint(1) NOT NULL DEFAULT '0' COMMENT '判断是否是第一次弹出私人发布弹框（0：是  1：否）',
  `default_pic` tinyint(1) NOT NULL DEFAULT '0' COMMENT '默认图记录 0：第一次发布 1：非第一次发布',
  `isablebean` tinyint(1) NOT NULL DEFAULT '0' COMMENT '判断是否是第一次弹能否用金豆框（0：是 1：否）',
  `role_id` int(11) DEFAULT NULL COMMENT '角色ID',
  `head_url` varchar(200) DEFAULT NULL COMMENT '头像路径',
  `last_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后登录时间',
  `user_status` int(11) NOT NULL DEFAULT '0' COMMENT '状态（枚举类型 0：正常 1：锁定 2：拉黑）',
  `device_id` varchar(200) DEFAULT NULL COMMENT '设备号 游客登录用',
  `device_type` int(11) NOT NULL DEFAULT '0' COMMENT '设备类型（0：未知，1：IOS，2：Android）',
  `device_token` varchar(100) DEFAULT NULL COMMENT '设备号',
  `create_by` bigint(20) NOT NULL DEFAULT '0' COMMENT '创建人',
  `create_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_by` bigint(20) DEFAULT NULL COMMENT '最后更新人',
  `update_date` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后更新时间',
  `is_delete` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否已删除',
  `lottery_attention` tinyint(1) NOT NULL DEFAULT '1' COMMENT '开奖提醒开关（0：关 1：开）',
  `bet_attention` tinyint(1) NOT NULL DEFAULT '1' COMMENT '开奖提箱开关（0：关 1：开）',
  `message_attention` tinyint(1) NOT NULL DEFAULT '1' COMMENT '消息提醒开关（0：关 1：开）',
  PRIMARY KEY (`user_id`),
  UNIQUE KEY `user_name` (`user_name`),
  UNIQUE KEY `wxopenid` (`wxopenid`),
  KEY `phonenumber` (`phonenumber`),
  KEY `user_type` (`user_type`),
  KEY `is_delete` (`is_delete`),
  KEY `last_time` (`last_time`)
) ENGINE=InnoDB AUTO_INCREMENT=100000082 DEFAULT CHARSET=utf8 COMMENT='用户基本信息';

