  `roll_level` int(11) NOT NULL DEFAULT '1' COMMENT '优先级（数值越大优先级越高）',
  `roll_times` int(11) NOT NULL DEFAULT '1' COMMENT '轮播次数（0：表示无限制）',
  `marquee_type` int(11) NOT NULL DEFAULT '0' COMMENT '跑马灯类型（10：系统消息 20：赠送金币 30：玩家充值 40：庄家赢利 50：庄家亏损 60：玩家赢利）',
  `link_url` varchar(255) DEFAULT '' COMMENT '链接URL',
  `task_id` bigint(20) DEFAULT NULL COMMENT '竞猜项目ID',
  `create_by` bigint(20) NOT NULL DEFAULT '1' COMMENT '创建人',
  `create_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_by` bigint(20) DEFAULT NULL COMMENT '最后更新人',
  `update_date` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后更新时间',
  `is_delete` tinyint(3) NOT NULL DEFAULT '0' COMMENT '是否已删除',
  PRIMARY KEY (`roll_id`)
) ENGINE=InnoDB AUTO_INCREMENT=14322 DEFAULT CHARSET=utf8mb4 COMMENT='跑马灯消息队列';

-- ----------------------------
-- Records of t_marquee_queue
-- ----------------------------

-- ----------------------------
-- Table structure for `t_matches`
-- ----------------------------
DROP TABLE IF EXISTS `t_matches`;
CREATE TABLE `t_matches` (
  `match_id` int(20) NOT NULL AUTO_INCREMENT,
  `status` int(11) NOT NULL DEFAULT '1' COMMENT '比赛状态：1-未开赛，2-进行中，3-已结束',
  `match_type` int(11) NOT NULL DEFAULT '1' COMMENT '比赛类型:1-篮球，2-足球',
  `home_team_id` bigint(20) NOT NULL COMMENT '主场球队ID',
  `home_score` int(20) DEFAULT NULL COMMENT '主场球队得分',
  `away_team_id` bigint(20) NOT NULL COMMENT '客场球队ID',
  `away_score` int(20) DEFAULT NULL COMMENT '客场球队得分',
  `title` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '标题',
  `day_week` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '周几',
  `day_date` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '月日',
  `day_time` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '时分',
  `lock_time` datetime NOT NULL COMMENT '锁定竞猜时间',
  `open_time` datetime NOT NULL COMMENT '球赛开始时间',
  `settle_time` datetime NOT NULL COMMENT '球赛结束时间',
  `updatetime` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`match_id`)
) ENGINE=InnoDB AUTO_INCREMENT=573 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

-- ----------------------------
-- Records of t_matches
-- ----------------------------

-- ----------------------------
-- Table structure for `t_messages`
-- ----------------------------
DROP TABLE IF EXISTS `t_messages`;
CREATE TABLE `t_messages` (
  `Id` bigint(20) NOT NULL AUTO_INCREMENT,
  `task_id` bigint(20) DEFAULT NULL COMMENT '项目ID',
  `msg` varchar(255) NOT NULL DEFAULT '' COMMENT '消息内容',
  `send_user` bigint(20) NOT NULL DEFAULT '1' COMMENT '消息发送人',
  `send_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '发送时间',
  `create_by` bigint(20) NOT NULL DEFAULT '1' COMMENT '创建人',
  `create_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_by` bigint(20) DEFAULT NULL COMMENT '最后更新人',
  `update_date` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后更新时间',
  `is_delete` tinyint(3) NOT NULL DEFAULT '0' COMMENT '是否已删除',
  `msg_id` bigint(20) DEFAULT '1' COMMENT '消息在房间中的id，作为消息计数',
  PRIMARY KEY (`Id`),
  KEY `task_id` (`task_id`),
  KEY `send_user` (`send_user`),
  KEY `is_delete` (`is_delete`)
) ENGINE=InnoDB AUTO_INCREMENT=682 DEFAULT CHARSET=utf8mb4 COMMENT='聊天记录';

-- ----------------------------
-- Records of t_messages
-- ----------------------------

-- ----------------------------
-- Table structure for `t_operate_log`
-- ----------------------------
DROP TABLE IF EXISTS `t_operate_log`;
CREATE TABLE `t_operate_log` (
  `operate_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `operate_type` bigint(20) NOT NULL COMMENT '1:登录，2-发布，3-下注',
  `user_id` bigint(20) NOT NULL COMMENT '用户id',
  `task_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '任务id',
  `operate_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '操作时间',
  `quantity` int(20) NOT NULL DEFAULT '1' COMMENT '数量.比如下注操作的下注数量',
  `status` int(1) NOT NULL DEFAULT '0',
  PRIMARY KEY (`operate_id`)
) ENGINE=InnoDB AUTO_INCREMENT=17984 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

-- ----------------------------
-- Records of t_operate_log
-- ----------------------------

-- ----------------------------
-- Table structure for `t_orders`
-- ----------------------------
DROP TABLE IF EXISTS `t_orders`;
CREATE TABLE `t_orders` (
  `order_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '订单ID',
  `order_code` varchar(50) NOT NULL DEFAULT '' COMMENT '订单编号',
  `user_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '买家ID',
  `order_type` tinyint(3) NOT NULL DEFAULT '0' COMMENT '订单类型（1：商城兑换 0：普通销售订单）',
  `order_status` tinyint(3) DEFAULT '10' COMMENT '订单状态（10：已下单 20：已支付/待审核 30：配送中 40：已收货 50：退款中 60：退货中 99：已取消）',
  `item_id` int(11) NOT NULL DEFAULT '0' COMMENT '商品ID',
  `item_code` varchar(50) NOT NULL DEFAULT '' COMMENT '商品编号',
  `item_name` varchar(200) NOT NULL DEFAULT '' COMMENT '商品名称',
  `qty` int(11) NOT NULL DEFAULT '1' COMMENT '数量',
  `price_coins` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '兑换单价（金币）',
  `coins_amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '兑换总价（金币）',
  `addr_contact` varchar(50) NOT NULL DEFAULT '' COMMENT '联系人',
  `addr_tel` varchar(20) NOT NULL DEFAULT '' COMMENT '联系电话',
  `addr1` varchar(255) NOT NULL DEFAULT '' COMMENT '联系地址',
  `addr2` varchar(255) NOT NULL DEFAULT '' COMMENT '详细地址',
  `addr_code` int(11) DEFAULT NULL COMMENT '城市编号',
  `addr_lng` float DEFAULT NULL COMMENT '经度',
  `addr_lat` float DEFAULT NULL COMMENT '纬度',
  `remarks` varchar(200) DEFAULT NULL COMMENT '备注',
  `logistics_number` varchar(100) DEFAULT NULL COMMENT '物流单号',
  `create_by` bigint(20) NOT NULL DEFAULT '1' COMMENT '创建人',
  `create_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_by` bigint(20) DEFAULT NULL COMMENT '最后更新人',
  `update_date` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后更新时间',
  `is_delete` tinyint(3) NOT NULL DEFAULT '0' COMMENT '是否已删除',
  PRIMARY KEY (`order_id`),
  UNIQUE KEY `order_code` (`order_code`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='销售订单';

-- ----------------------------
-- Records of t_orders
-- ----------------------------

-- ----------------------------
-- Table structure for `t_payments`
-- ----------------------------
DROP TABLE IF EXISTS `t_payments`;
CREATE TABLE `t_payments` (
  `payment_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '支付单号',
  `bill_type` int(11) NOT NULL DEFAULT '0' COMMENT '订单类型（0：金币充值 1：商城订单）',
  `bill_no` bigint(20) NOT NULL DEFAULT '0' COMMENT '关联单据号（充值订单号或者商城订单号）',
  `total_amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '支付总金额',
  `create_by` bigint(20) NOT NULL DEFAULT '0' COMMENT '创建人',
  `create_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_by` bigint(20) DEFAULT NULL COMMENT '最后更新人',
  `update_date` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后更新时间',
  `is_delete` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否已删除',
  PRIMARY KEY (`payment_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='支付记录';

-- ----------------------------
-- Records of t_payments
