-- ----------------------------
-- Table structure for `t_play_odds`
-- ----------------------------
DROP TABLE IF EXISTS `t_play_odds`;
CREATE TABLE `t_play_odds` (
  `odds_id` int(11) NOT NULL AUTO_INCREMENT,
  `match_id` int(11) DEFAULT '0' COMMENT '球赛ID',
  `play_id` int(11) NOT NULL COMMENT '玩法类型',
  `ball_number` decimal(18,2) DEFAULT '0.00' COMMENT '基础球数',
  `concede_points_show` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '赔率展示的数据',
  `his_odds` decimal(18,2) DEFAULT NULL COMMENT '主场赔率',
  `win_odds` decimal(18,2) DEFAULT NULL COMMENT '客场赔率',
  `tie_odds` decimal(18,2) DEFAULT NULL COMMENT '平局赔率',
  `big_ball_odds` decimal(18,2) DEFAULT NULL COMMENT '大球赔率',
  `is_default` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT '0',
  `small_ball_odds` decimal(18,2) DEFAULT NULL COMMENT '小球赔率',
  PRIMARY KEY (`odds_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1519 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

-- ----------------------------
-- Records of t_play_odds
