-- ----------------------------
-- Table structure for `t_play_types`
-- ----------------------------
DROP TABLE IF EXISTS `t_play_types`;
CREATE TABLE `t_play_types` (
  `play_id` int(11) NOT NULL AUTO_INCREMENT,
  `paly_type` int(11) NOT NULL COMMENT '玩法类型：1-标准盘，2-大小球，3-让球',
  `play_name` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '玩法名称',
  PRIMARY KEY (`play_id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

-- ----------------------------
-- Records of t_play_types
