-- ----------------------------
-- Table structure for `t_recharges`
-- ----------------------------
DROP TABLE IF EXISTS `t_recharges`;
CREATE TABLE `t_recharges` (
  `recharge_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '充值记录ID',
  `user_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '充值用户',
  `recharge_status` int(11) NOT NULL COMMENT '充值状态(0：支付中，1：支付成功，2：支付失败)',
  `recharge_code` varchar(50) NOT NULL DEFAULT '' COMMENT '充值订单号',
  `recharge_amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '充值金额',
  `pay_amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '支付金额',
  `pay_time` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '支付时间',
  `pay_code` varchar(255) DEFAULT NULL COMMENT '支付单号（微信或支付宝）',
  `recharge_coins` int(11) NOT NULL COMMENT '充值金币',
  `activity_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '活动ID',
  `activity_coins` int(11) NOT NULL COMMENT '活动赠送金币',
  `iap_receipt` text COMMENT '苹果支付凭证',
  `create_by` bigint(20) NOT NULL DEFAULT '0' COMMENT '创建人',
  `create_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_by` bigint(20) DEFAULT NULL COMMENT '最后更新人',
  `update_date` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后更新时间',
  `is_delete` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否已删除',
  PRIMARY KEY (`recharge_id`),
  UNIQUE KEY `idx_recharge_code` (`recharge_code`),
  KEY `is_delete` (`is_delete`),
  KEY `idx_recharge_userid` (`user_id`),
  KEY `idx_recharge_status` (`recharge_status`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 COMMENT='充值记录';

-- ----------------------------
-- Records of t_recharges
