-- ----------------------------
-- Table structure for `t_sms_messages`
-- ----------------------------
DROP TABLE IF EXISTS `t_sms_messages`;
CREATE TABLE `t_sms_messages` (
  `sms_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '短信ID',
  `mobile` varchar(20) NOT NULL DEFAULT '' COMMENT '手机号',
  `message_type` int(11) NOT NULL DEFAULT '0' COMMENT '短信类型（0：验证码 1：普通短信）',
  `content` varchar(255) NOT NULL DEFAULT '' COMMENT '短信内容',
  `create_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `process_date` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '处理时间',
  `message_status` int(11) NOT NULL DEFAULT '0' COMMENT '消息状态（0：待发送，1：发送成功 2：发送失败）',
  `is_delete` int(11) NOT NULL DEFAULT '0' COMMENT '是否已删除',
  PRIMARY KEY (`sms_id`),
  KEY `idx_smsmsg_mobile` (`mobile`),
  KEY `idx_smsmsg_type` (`message_type`),
  KEY `idx_smsmsg_status` (`message_status`),
  KEY `idx_smsmsg_createdate` (`create_date`),
  KEY `idx_smsmsg_process_date` (`process_date`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='短信队列';

-- ----------------------------
-- Records of t_sms_messages
-- ----------------------------

-- ----------------------------
-- Table structure for `t_tasks`
-- ----------------------------
DROP TABLE IF EXISTS `t_tasks`;
CREATE TABLE `t_tasks` (
  `task_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '项目ID',
  `user_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '所属用户ID',
  `task_title` varchar(50) DEFAULT '' COMMENT '项目标题',
  `task_type` int(2) NOT NULL DEFAULT '0' COMMENT '项目类型（0：图文竞猜 1：足彩）',
  `match_id` bigint(20) DEFAULT NULL,
  `match_type` int(1) DEFAULT NULL COMMENT '体育类：1-足球，2-篮球',
  `play_type` int(1) DEFAULT NULL COMMENT '足球类玩法：1-标准盘，2-让球，3-大小球',
  `concede_points_show` varchar(20) DEFAULT NULL,
  `concede_points` decimal(10,2) DEFAULT NULL COMMENT '让球数或盘口',
  `task_content` varchar(200) DEFAULT NULL COMMENT '内容描述',
  `sale_price` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '单注金币',
  `quantity` int(11) NOT NULL DEFAULT '0' COMMENT '总注数',
  `sale_amount` int(11) NOT NULL DEFAULT '0' COMMENT '销售总金币',
  `task_status` int(2) NOT NULL DEFAULT '20' COMMENT '项目状态（10：审核中（先保留） 20：未开奖  30：已开奖 40：已取消 50：已暂停（后台操作））',
  `hot` tinyint(1) unsigned DEFAULT '0' COMMENT '是否热门',
  `personal` int(11) NOT NULL DEFAULT '0' COMMENT '是否私密发布',
  `like_peas` int(11) NOT NULL DEFAULT '0' COMMENT '是否接受金豆（我喜欢豌豆~）',
  `lottery_type` int(11) NOT NULL DEFAULT '0' COMMENT '开奖方式（0：自动开奖 1：手动开奖）',
  `lock_time` timestamp NULL DEFAULT NULL COMMENT '锁定下注时间，超过之后不能下注',
  `settle_time` timestamp NULL DEFAULT NULL COMMENT '开奖时间',
  `settle_coins` decimal(10,1) DEFAULT '0.0' COMMENT '金币盈亏合计（亏本为负数）',
  `parent_id` bigint(20) DEFAULT NULL COMMENT '复制某个竞猜的ID',
  `locked_coins` decimal(10,1) NOT NULL DEFAULT '0.0' COMMENT '本次发布锁定的金币（复制发布可能没有正确答案，按最大的赔率锁定，这里记录下来开奖计算用）',
  `lottery_result` varchar(255) DEFAULT NULL COMMENT '开奖结果，json格式字符串',
  `create_by` bigint(20) NOT NULL DEFAULT '0' COMMENT '创建人',
  `create_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_by` bigint(20) DEFAULT NULL COMMENT '最后更新人',
  `update_date` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后更新时间',
  `is_delete` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否已删除',
  PRIMARY KEY (`task_id`),
  KEY `idx_task_userid` (`user_id`),
  KEY `idx_task_type` (`task_type`),
  KEY `idx_task_hot` (`hot`),
  KEY `idx_task_isdelete` (`is_delete`),
  KEY `idx_task_settletime` (`settle_time`)
) ENGINE=InnoDB AUTO_INCREMENT=979 DEFAULT CHARSET=utf8 COMMENT='项目';

-- ----------------------------
-- Records of t_tasks
-- ----------------------------

-- ----------------------------
-- Table structure for `t_task_answers`
-- ----------------------------
DROP TABLE IF EXISTS `t_task_answers`;
CREATE TABLE `t_task_answers` (
  `answer_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '答案ID',
  `task_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '项目ID',
  `answer` varchar(50) NOT NULL DEFAULT '' COMMENT '答案',
  `is_right` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否正确答案',
  `odds` decimal(10,2) NOT NULL DEFAULT '1.00' COMMENT '赔率',
  `parent_answ` bigint(20) DEFAULT NULL COMMENT '复制主竞猜项目对应的答案ID',
  `create_by` bigint(20) NOT NULL DEFAULT '0' COMMENT '创建人',
  `create_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_by` bigint(20) DEFAULT NULL COMMENT '最后更新人',
  `update_date` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后更新时间',
  `is_delete` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否已删除',
  PRIMARY KEY (`answer_id`),
  KEY `is_delete` (`is_delete`)
) ENGINE=InnoDB AUTO_INCREMENT=2110 DEFAULT CHARSET=utf8 COMMENT='项目答案列表';

-- ----------------------------
-- Records of t_task_answers
-- ----------------------------

-- ----------------------------
-- Table structure for `t_task_football`
-- ----------------------------
DROP TABLE IF EXISTS `t_task_football`;
CREATE TABLE `t_task_football` (
  `tfb_id` bigint(20) NOT NULL AUTO_INCREMENT,
  `task_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '项目ID',
  `team_logo` varchar(255) DEFAULT NULL COMMENT '球队头像',
  `team_name` varchar(255) NOT NULL DEFAULT '' COMMENT '球队名称',
  `court_type` int(2) NOT NULL DEFAULT '0' COMMENT '枚举（0：主场 1：客场）',
  `create_by` bigint(20) NOT NULL DEFAULT '0' COMMENT '创建人',
  `create_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_by` bigint(20) DEFAULT NULL COMMENT '最后更新人',
  `update_date` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后更新时间',
  `is_delete` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否已删除',
  PRIMARY KEY (`tfb_id`)
) ENGINE=InnoDB AUTO_INCREMENT=819 DEFAULT CHARSET=utf8 COMMENT='足彩（双方）';

-- ----------------------------
-- Records of t_task_football
-- ----------------------------

-- ----------------------------
-- Table structure for `t_task_lottery_logs`
-- ----------------------------
DROP TABLE IF EXISTS `t_task_lottery_logs`;
CREATE TABLE `t_task_lottery_logs` (
  `Id` bigint(20) NOT NULL AUTO_INCREMENT,
  `task_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '竞猜项目ID',
  `user_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '所属用户',
  `lottery_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '开奖时间',
  `lottery_result` text COMMENT '开奖结果，json格式字符串',
  `is_success` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否成功（0：失败 1：成功）',
  `error_msg` varchar(500) DEFAULT '' COMMENT '错误原因',
