  `create_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_by` bigint(20) DEFAULT NULL COMMENT '最后更新人',
  `update_date` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后更新时间',
  `is_delete` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否已删除',
  PRIMARY KEY (`Id`)
) ENGINE=InnoDB AUTO_INCREMENT=745 DEFAULT CHARSET=utf8mb4 COMMENT='开奖处理日志';

-- ----------------------------
-- Records of t_task_lottery_logs
-- ----------------------------

-- ----------------------------
-- Table structure for `t_task_orders`
-- ----------------------------
DROP TABLE IF EXISTS `t_task_orders`;
CREATE TABLE `t_task_orders` (
  `tord_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '订单ID',
  `task_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '项目ID',
