DROP TRIGGER IF EXISTS `ut_client_insert`;
DELIMITER ;;
CREATE TRIGGER `ut_client_insert` AFTER INSERT ON `m_users` FOR EACH ROW BEGIN 
		declare v_coin_balance int; 
		declare v_coin_income int; 
		declare v_activity_id int;
		declare v_account_id int;
			 
		-- 是否有新用户金币赠送活动 
		select return_value, 
		       return_value,
		       activity_id into v_coin_balance,v_coin_income, v_activity_id
		FROM   t_activitys 
		WHERE  activity_type = 0 
		AND    is_delete = 0 
		AND    validity_start <= current_timestamp 
		AND    validity_end > current_timestamp; 
		
		-- 插入用户账户表 
                        user_id, 
                        task_count, 
                        task_join , 
                        coin_balance, 
                        coin_income, 
                        coin_expend, 
                        coin_locked , 
                        recharge_amount, 
                        member_points , 
                        create_by, 
                        create_date, 
                        update_by, 
                        update_date, 
                        is_delete 
            ) 
            VALUES 
            ( 
                        new.user_id, 
                        0,
						0, 
                        v_coin_balance,  
                        v_coin_income, 
                        0, 
                        0, 
                        0,
						0, 
                        new.create_by, 
                        now(), 
                        new.create_by, 
                        now(), 
                        0 
            ); 

			-- 生成账户明细记录 
			if v_coin_balance > 0 then 
			
			  select account_id into v_account_id
			  FROM   t_user_account 
			  WHERE  user_id = new.user_id; 
			   
			                          account_id , 
			                          user_id , 
			                          coins , 
			                          from_type , 
			                          task_id , 
			                          tord_id , 
			                          order_id , 
			                          recharge_id , 
			                          activity_id , 
			                          create_by , 
			                          create_date , 
			                          update_by , 
			                          update_date , 
			                          is_delete 
			              ) 
			              VALUES 
			              ( 
			                          v_account_id, 
			                          new.user_id, 
			                          v_coin_income, 
			                          7, 
			                          NULL, 
			                          NULL, 
			                          NULL, 
			                          NULL, 
			                          v_activity_id, 
			                          new.user_id, 
			                          now(), 
			                          new.user_id, 
			                          now(), 
			                          0 
			              );
			end if; 
END
;;
DELIMITER ;
DROP TRIGGER IF EXISTS `ut_recharge_update`;
DELIMITER ;;
CREATE TRIGGER `ut_recharge_update` AFTER UPDATE ON `t_recharges` FOR EACH ROW BEGIN 
	declare v_account_id int;

	if new.recharge_status = 1 and old.recharge_status != 1 then
		select account_id into v_account_id
		from t_user_account 
		where user_id = new.user_id and coin_type = 0;
		
		-- 更新金额合计
		update t_user_account 
		set recharge_amount = recharge_amount + new.recharge_amount
		    ,coin_balance = coin_balance + new.recharge_coins + new.activity_coins
		    ,coin_income = coin_income + new.recharge_coins + new.activity_coins
		where t_user_account.account_id = v_account_id;
		
		-- 生成账户收支明细
	    /*
	    收支来源 
	    
	    Recharge(0,"充值金币"),
	    RechargeReward(1,"充值送金币"),
	    TaskReward(2,"竞猜收入"),
	    TaskCost(3,"竞猜下注"),
	    ItemExchange(4,"商品兑换"),
	    TaskLotteryIncome(5,"发布竞猜盈利"),
	    TaskLotteryExpend(6,"发布竞猜赔付"),
	    RegisterReward(7,"新用户注册奖励"),
	    LoginReward(8,"登录奖励");
	    */
		values(v_account_id,new.user_id,new.recharge_coins,0,new.recharge_id);
			
		-- 充值有活动赠送金币时，生成收入明细
		if new.activity_id > 0 and new.activity_coins > 0 then
			values(v_account_id,new.user_id,new.activity_coins,1,new.recharge_id,new.activity_id);
		end if;
	    
	end if;
	
	-- TODO 计算积分
		
END
;;
DELIMITER ;
